// Q4 2019
var featureCollection = Perairan_dalamQ4_19.merge(Perairan_dangkalQ4_19).merge(Lahan_terbangun_dan_terbukaQ4_19)
                        .merge(Vegetasi_krptn_rendahQ4_19).merge(Vegetasi_krptn_sedangQ4_19)
                        .merge(Vegetasi_krptn_tinggiQ4_19).merge(AwanQ4_19)
                        .merge(Perairan_dangkalQ4_19).merge(Bayangan_awanQ4_19);
// Mendefinisikan band yang akan digunakan dalam klasifikasi
var bands = ['B8','B4','B3','B2'];
// Mendefinisikan sampel  pada featureCollection
var trainingQ4_19 = Q4_19KAL.select(bands).sampleRegions({
collection: featureCollection,
properties: ['lc'],
scale: 10
});
// Acak sampel
var RandomQ4_19  = trainingQ4_19.randomColumn('random');
// Pembagian sampel model dan uji
var split = 0.7;  // 70% model, 30% uji.
var sampelModelQ4_19 = RandomQ4_19.filter(ee.Filter.lt('random', split));
var sampelUjiQ4_19 = RandomQ4_19.filter(ee.Filter.gte('random', split));
// Eksekusi klasifikasi (Algoritma Classification and Regression Tree)
var klasifikasiQ4_19 = ee.Classifier.smileCart().train({
features: sampelModelQ4_19,
classProperty: 'lc',
inputProperties: bands
});
// Uji akurasi
var kelasUjiQ4_19 = sampelUjiQ4_19.classify(klasifikasiQ4_19);
// untuk kemudian dapat diperoleh nilai eror dan akurasi
var confusionMatrixCARTQ4_19 = kelasUjiQ4_19.errorMatrix('lc', 'classification');
print('Confusion Matrix CART Q4_19KAL: ', confusionMatrixCARTQ4_19);
print('Overall Accuracy CART Q4_19KAL: ', confusionMatrixCARTQ4_19.accuracy());
var hasilKlasifikasiQ4_19  = Q4_19KAL.classify(klasifikasiQ4_19);
print(hasilKlasifikasiQ4_19)
Map.addLayer(hasilKlasifikasiQ4_19, visParam,'Land Cover Q4_19KAL');
